	(1,'10 dicas para aumentar sua Massa Muscular','','1990-09-19','Não treine mais que 5 dias por semana. Fazer isso não só é desnecessário, mas também pode te levar ao overtraining. Se você estiver fazendo cardio ou alguma outra atividade física, reduza','<p><strong>1- N&atilde;o treine mais que 5 dias por semana. </strong><br />Fazer isso n&atilde;o s&oacute; &eacute; desnecess&aacute;rio, mas tamb&eacute;m pode te levar ao overtraining. Se voc&ecirc; estiver fazendo cardio ou alguma outra atividade f&iacute;sica, reduza ainda mais seus treinos (em dias ou numero de exerc&iacute;cios).</p>\r\n<p><strong>2- Limite os seus treinos em 30 a 45 minutos e 15 a 20 s&eacute;ries no total.</strong> <br />Se voc&ecirc; n&atilde;o conseguir construir m&uacute;sculos assim, n&atilde;o vai ser indo al&eacute;m que ter&aacute; resultados. Lembre-se, os resultados s&atilde;o maiores quando os n&iacute;veis de energia e foco mental est&atilde;o no m&aacute;ximo e isso acontece nos 30 minutos iniciais do seu treino. Ap&oacute;s meia hora a pot&ecirc;ncia e o foco come&ccedil;am a diminuir.</p>\r\n<p><strong>3- Use exerc&iacute;cios compostos e cargas pesadas. Levantamento Terra, Desenvolvimento, Agachamento e Sulpino s&atilde;o alguns exemplos.</strong><br /> Esses s&atilde;o os respons&aacute;veis pelos  grandes f&iacute;sicos desde o inicio do bodybuilding. Altas cargas tamb&eacute;m s&atilde;o importantes, ou voc&ecirc; j&aacute; viu algum margrelo fazendo sulpino com 100kg???</p>\r\n<p><strong>4- Aumente as cargas sempre que poss&iacute;vel e mantenha um di&aacute;rio de treinamento para acompanhar seus resultados.</strong><br />A sobrecarga progressiva &eacute; um dos princ&iacute;pios b&aacute;sicos para ter m&uacute;sculos grandes. Siga esta regra e voc&ecirc; vai ficar maior e mais forte sempre. Ignore  e voc&ecirc; n&atilde;o vai conseguir nada. Escreva metas semestrais em seu di&aacute;rio de treino. Por exemplo, se faz sulpino hoje com 60kg coloque como meta para daqui 6 meses 80kg e lute por ela, nem que seja de 1/2 em 1/2 kg. Mas lembre-se de aumentar o peso e fazer o movimento perfeito, mais pesos &eacute; p&eacute;ssima execu&ccedil;&atilde;o n&atilde;o v&atilde;o te levar a lugar nenhum.</p>\r\n<p>5- Treine com varias faixas de repeti&ccedil;&atilde;o (1 a 20 dependendo do m&uacute;sculo). Isso vai fazer com que voc&ecirc; trabalhe todos os tipos de fibras musculares, o  maximiza a capacidade de constru&ccedil;&atilde;o muscular.     6- Sempre mude seus treinos de 4 em 4 semanas. Ap&oacute;s esse per&iacute;odo seus m&uacute;sculos v&atilde;o se adaptar e os ganhos v&atilde;o come&ccedil;ar a serem menores. Se voc&ecirc; treina a muito tempo (mais de 5 anos) seus m&uacute;sculos podem se adaptar ainda mais r&aacute;pido e por isso voc&ecirc; pode mudar os exerc&iacute;cios com mais freq&uuml;&ecirc;ncias.     7- Tenha um compromisso com sua dieta. &Eacute; a alimenta&ccedil;&atilde;o que vai fazer voc&ecirc; crescer. As quantidades certas de calorias e a divis&atilde;o de nutrientes s&atilde;o 70% do processo, os outros 30% ficam por conta dos treinos. Pode acreditar. Fa&ccedil;a uma experi&ecirc;ncia e vai ver.     8- Coma comida. Parece b&aacute;sico, mas muita gente esquece disso. Comida integral vai ajudar baixar seu percentual de gordura e assim deixar seus m&uacute;sculos mais a mostra. Al&eacute;m de conter todas as vitaminas e minerais necess&aacute;rios para recupera&ccedil;&atilde;o muscular e o bom funcionamento do seu corpo. Fa&ccedil;a de conta que n&atilde;o existe comida processada, que n&atilde;o existe enlatados e fast foods. Como comida 90% integral. Exemplo:     - Prote&iacute;na: Carnes, Ovos, Peixe, Frango, Leite&hellip;..  - Carboidratos: Arroz Integral, Aveia, Massas Integral&hellip;&hellip;..  - Vegetais: Espinafre, Couve, Br&oacute;colis, Tomate, Cenoura, Repolho, Berinjela&hellip;&hellip;.  - Frutas: Banana, Ma&ccedil;a, Laranja, Goiaba&hellip;&hellip;  - Gorduras: Azeite Extra Virgem, &Oacute;leo de Peixe (Omega 3), Nozes, Castanhas, Am&ecirc;ndoas&hellip;&hellip;&hellip;.     9- Durma pelo menos 8 horas por dia, e no m&aacute;ximo 10. Dormir de menos atrapalha a recupera&ccedil;&atilde;o muscular. Dormir demais faz voc&ecirc; entrar em catabolismo. N&atilde;o subestime esse fator imprescind&iacute;vel.     10- Encontre um parceiro de treino. N&atilde;o s&oacute; por que ele te ajuda a ir ao limite, ou por que ele te salva quando a barra esta para cair no seu pesco&ccedil;o e sim pela competi&ccedil;&atilde;o. Isso &eacute; o b&aacute;sico do instinto humano. Com raras exce&ccedil;&otilde;es, ningu&eacute;m gosta de perder e ver o seu parceiro de treino puxando mais ferro que voc&ecirc; vai te machucar, e isso vai te trazer a for&ccedil;a que voc&ecirc; nunca imaginou ter.</p>','','Por: Rodrigo Ruppert',1,'2010-07-05 00:47:35',NULL),
